import React from "react";
import NumberCell from "./NumberCell";

export default function Board({ board, onRemove }) {
  // TODO: 셀 선택/제거 로직 구현
  return (
    <table>
      <tbody>
        {board.map((row, i) => (
          <tr key={i}>
            {row.map((num, j) => (
              <NumberCell key={j} value={num} row={i} col={j} />
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
}
